import React, { Component } from 'react';
import './Home.css';
import image from './img/Lakeland.jpg'
import Unsplash from 'react-unsplash-wrapper';



class Home extends Component {

    render() { 
        return ( 
            <div class="d-flex justify-content-center">
                <figure class="figure">
                <Unsplash width="400" height="300" keywords="kitten" class="figure-img img-fluid rounded mx-auto d-block" img />
                    <img src={image} class="figure-img img-fluid rounded mx-auto d-block" alt="A generic square placeholder image with rounded corners in a figure."/>
                    <figcaption class="figure-caption text-right">A caption for the above image.</figcaption>
                </figure>

                <div style={{position: 'relative', width: 400, height: 400, margin: 'auto'}}>
  <Unsplash expand />
</div>

                <figure class="figure">
                    <img src={image} class="figure-img img-fluid rounded" alt="A generic square placeholder image with rounded corners in a figure."/>
                    <figcaption class="figure-caption text-right">A caption for the above image.</figcaption>
                </figure>
            </div>
        );
    }
}

export default Home;
